import React, { useContext } from 'react';
import PassportContext from '../../contexts/passportContext';
import { NavLink } from 'react-router-dom';

const Navigation = () => {

    const { cityData } = useContext(PassportContext);

    return (
        <div className='navigation'>
            <div className='logo'>Restaurant Passport</div>
            <div className='nav-links'>
                <NavLink to='/'>Restaurants</NavLink>
                <NavLink to='/passport'>
                    My Passport <span>{cityData.length}</span>
                </NavLink>
                <button className='btn btn-outline-primary'>Try it FREE</button>
            </div>
        </div>
    );
};

export default Navigation;
